content=Quien dice que en mujeres no hay firmeza, / no os puede haber, señora, conocido, / ni menos el que dicen que han nacido / de un parto la crueldad y la belleza. / Un alma noble, una real pureza / de un cuerpo de cristal hicieron nido; / el mismo ser está con vos corrido, / y admirada de sí naturaleza. / Firme sois, y mujer, si son contrarios, / hoy vuestro pecho con victoria quede, / de que es sujeto que los ha deshecho.

